import React from 'react';
import Link from 'next/link';

const categoryNavigationStyle = {
    display: 'flex',
    flexDirection: 'row',
}

function CategoryNavigation() {
    return (
        <ul className="category-navigation">
            <li key="all">
                <Link href="/">
                    전체
                </Link>
            </li>
            <li key="foods">
                <Link href="/foods">
                    음식
                </Link>
            </li>
            <li key="clothes">
                <Link href="/clothes">
                    의류
                </Link>
            </li>
            <li key="convenience">
                <Link href="/convenience">
                    생활편의
                </Link>
            </li>
        </ul>
    );
}

export default CategoryNavigation;
